import * as database from "../../utils/helper/database";

export function readSystemInformation() {
    const ref = "systemPackaging0/management";
    return new Promise((resolve, reject) => {
        database
            .readData({ref})
            .then(info => {
                resolve(info);
            })
            .catch(error => {
                reject(error);
            });
    });
}
